column36:
Why did Liberal MP Turnbull secretly bring to Australia a British Marxist-Green newspaper, The Guardian?

Was it to create public support for the climate-change hoax and ensure that his planned investments in renewables succeed?

The events of 2012–2015 seem very suspicious.  These facts are worth repeating: 

* 2012 -— while Abbott attacks  Labor government’s carbon tax and energy policies and promises to stop renewable subsidies and the punitive carbon tax, Liberal MP Turnbull secretly negotiates the establishment of The Guardian in Australia;
*  2013 Tony Abbott wins 18 seats in landslide election, stops energy subsidies and removes carbon tax. The Guardian starts publishing anti-Abbott articles in Australia;
* manufacturer of wind-energy  equipment, INFIGEN, faces bankruptcy without government subsidies; its shares hit the lowest price ever of 20c;
* Alex Turnbull, Malcolm’s son, buys up the cheap Infigen shares;
* 2014-2015 The smearing of Abbott becomes unrelenting; The Guardian and ABC hound Abbott and are instrumental in his loss of popularity and support while they laud Turnbull; 
* 2015—Abbott loses office and Turnbull replaces him;
* 2016—Turnbull’s government signs the Paris agreement and commits Australia to globalist-communist UN’s energy policy;
*  INFIGEN SHARES JUMP SIX-FOLD, TO $1.20 EACH—the industry servicing the climate scam is safe again;
* the Turnbulls make a six-fold profit on their investment;
* Australians’ electricity bills sky-rocket;
* 2016 Turnbull calls an election and loses 14 seats,  retaining government with only a one-seat majority. 

It’s a treacherous act when a MP from a Conservative party secretly brings in a Marxist foreign publisher who  will always undermine and oppose conservative policies.
